import { ArrowBack, ArrowForward } from "@mui/icons-material";
import { Box, Card, Typography } from "@mui/material";
import Carousel from "react-material-ui-carousel";
import { GoogleMap, withScriptjs, withGoogleMap } from "@react-google-maps/api";

const MyMap = () => {
  const slides = [
    "https://learnphotographycanada.com/wp-content/uploads/2018/01/wallpaper.wiki-Awesome-bedroom-wallpaper-texture-black-PIC-WPC009500.jpg",
  ];
  const api = "AIzaSyCRRLDe0UQGmY9tRulQnTls8h1OoHJ3zhA";
  const mapOptions = {
    center: { lat: 40.7127, lng: -74.0059 },
    zoom: 13,
  };
  return (
    <div style={{ display: "flex", flexDirection: "column" }}>
      {/* <Carousel NextIcon={<ArrowForward />} PrevIcon={<ArrowBack />}>
        {slides.map((data, i) => (
          <Box
            sx={{
              //   padding: 10,
              display: "flex",
              justifyContent: "center",
              alignItems: "center",
              width: "100%",
              height: "50vh",
              backgroundImage: `url(${data})`,
              backgroundRepeat: "no-repeat",
              backgroundPosition: "center",
              backgroundSize: "cover",
              textAlign: "center",
              fontSize: "5vw",
              color: "#fff",
            }}
          >
            {i}
          </Box>
        ))}
      </Carousel> */}
      {/* <Typography variant="h2">hammad</Typography>
      <Typography variant="h2">hammad</Typography> */}
      <GoogleMap
        defaultOptions={mapOptions}
        defaultCenter={{ lat: 40.7127, lng: -74.0059 }}
        defaultZoom={13}
      />
    </div>
  );
};

const WrappedMap = withScriptjs(withGoogleMap(MyMap));

const Home = () => {
  return (
    <div style={{ width: "100vw", height: "100vh" }}>
      <WrappedMap
        googleMapURL={`https://maps.googleapis.com/maps/api/js?key=${process.env.api}&libraries=places`}
        loadingElement={<div style={{ height: "100%" }} />}
        containerElement={<div style={{ height: "100%" }} />}
        mapElement={<div style={{ height: "100%" }} />}
      />
    </div>
  );
};

export default Home;
